import LoginReducer from './LoginReducer';
import JobCategoryReducer from './JobCategoryReducer';

const { combineReducers } = require('redux');

const rootReducer = combineReducers({
	LoginReducer,
	JobCategoryReducer,
	WdListReducer,
});

export default rootReducer;
